    constructor(props) {
        super(props)

        this.state = {
                 
        }
    }

    logout(){
        localStorage.clear();
        location.href = 'localhost:3000';
    }

    render() {
        return (
            <div className='fixed-top'>
                <header>
                    <nav className="navbar navbar-expand-md bg-black">
                    <a href='/employees' className={Styles.logoImage}><img src={logo}  alt="logo" /></a>
                    </nav>
                    <h5 className='text-end'>Employee Management App<div>
   <a href="#" onClick={this.logout()}>LOGOUT</a>
</div></h5>
                </header>
            </div>
            
        )
    }
}

export default HeaderComponent
